# -*- coding: UTF-8 -*-
import requests
from random import sample, choice, randint
from datetime import datetime, timedelta
from urllib import request
from http import cookiejar
import re
from configparser import ConfigParser


config = ConfigParser()
config.read('push_config.ini', 'utf-8')


class PushTool:

    @staticmethod
    def get_proxy():
        return requests.get("http://127.0.0.1:5010/get/").content

    @staticmethod
    def random_chars(num):
        chars = 'qwertyuiopasdfghjklzxcvbnm1234567890'
        return ''.join(sample(chars, num))

    @staticmethod
    def random_num(num):
        chars = '1234567890'
        return ''.join(sample(chars, num))

    @staticmethod
    def random_path():
        chars = ['fangchan', 'zhaopin', 'ershou', 'jiaoyou', 'shenghuo', 'blog', 'qiye', 'news', 'keji', 'lvyou']
        return choice(chars)

    @staticmethod
    def random_time():
        today = datetime.today()
        yesterday = today + timedelta(days=randint(-5, 0))
        return yesterday.strftime("%Y%m%d")

    @staticmethod
    def get_url(domain):
        url = '%s/%s/%s%s.html' % (domain, PushTool.random_path(), PushTool.random_time(), PushTool.random_chars(5))
        return url

    @staticmethod
    def rand_url(domain):
        url = '%s%s/%s%s.html' % (
               domain,
               PushTool.random_chars(randint(3, 5)),
               PushTool.random_time(),
               PushTool.random_chars(randint(3, 5)))
        return url

    @staticmethod
    def rand_all(domain):
        target_url = []
        if isinstance(domain,list):
            for d in domain:
                if int(config.get('bd_push', 'type_one')) == 1:
                    """ http://abc.com/lsjxxxx/ """
                    target_url.append('%s%s/' % (d, PushTool.random_chars(randint(3, 5))))
                if int(config.get('bd_push', 'type_two')) == 1:
                    """ http://abc.com/lsjxxx/.html """
                    target_url.append('%s%s.html' % (d, PushTool.random_chars(randint(3, 5))))

                if int(config.get('bd_push', 'type_three')) == 1:
                    """ http://abc.com/lsjxxx/20181010xxx.html """
                    target_url.append('%s%s/%s%s.html' %
                                      (d, PushTool.random_chars(randint(3, 5)),
                                       PushTool.random_time(),
                                       PushTool.random_chars(randint(3, 5))))
                if int(config.get('bd_push', 'type_four')) == 1:
                    """ http://abc.com/lsjxxx/xxxx/ """
                    target_url.append('%s%s/%s/' %
                                      (d, PushTool.random_chars(randint(3, 5)),
                                       PushTool.random_chars(randint(5, 8))))

                if int(config.get('bd_push', 'type_five')) == 1:
                    """ http://abc.com/lsj20181010xxx.html """
                    target_url.append('%s%s%s.html' %
                                      (d, PushTool.random_time(),
                                       PushTool.random_chars(randint(3, 6))))
        else:
            if int(config.get('bd_push', 'type_one')) == 1:
                """ http://abc.com/lsjxxxx/ """
                target_url.append('%s%s/' % (domain, PushTool.random_chars(randint(3, 5))))
            if int(config.get('bd_push', 'type_two')) == 1:
                """ http://abc.com/lsjxxx/.html """
                target_url.append('%s%s.html' % (domain, PushTool.random_chars(randint(3, 5))))

            if int(config.get('bd_push', 'type_three')) == 1:
                """ http://abc.com/lsjxxx/20181010xxx.html """
                target_url.append('%s%s/%s%s.html' %
                                  (domain, PushTool.random_chars(randint(3, 5)),
                                   PushTool.random_time(),
                                   PushTool.random_chars(randint(3, 5))))
            if int(config.get('bd_push', 'type_four')) == 1:
                """ http://abc.com/lsjxxx/xxxx/ """
                target_url.append('%s%s/%s/' %
                                  (domain, PushTool.random_chars(randint(3, 5)),
                                   PushTool.random_chars(randint(5, 8))))

            if int(config.get('bd_push', 'type_five')) == 1:
                """ http://abc.com/lsj20181010xxx.html """
                target_url.append('%s%s%s.html' %
                                  (domain, PushTool.random_time(),
                                   PushTool.random_chars(randint(3, 6))))
        result=choice(target_url)
        # print('--result--',result)
        return result

    @staticmethod
    def get_cookies():
        # 声明一个CookieJar对象实例来保存cookie
        cookie = cookiejar.CookieJar()
        # 利用urllib.request库的HTTPCookieProcessor对象来创建cookie处理器,也就CookieHandler
        handler = request.HTTPCookieProcessor(cookie)
        # 通过CookieHandler创建opener
        opener = request.build_opener(handler)
        # 此处的open方法打开网页
        response = opener.open('https://www.baidu.com')
        # 打印cookie信息
        print_cookie = dict()
        for item in cookie:
            print_cookie[item.name] = item.value
        # print(print_cookie)
        return print_cookie

    @staticmethod
    def https_target():
        target = requests.get('https://zz.bdstatic.com/linksubmit/push.js')
        target_url = "%sgif" % re.findall(r"o=\"(.+?)gif", str(target.content))[0]
        return target_url

